import React, { useState } from "react";
import { useNavigate, Link } from "react-router-dom";
import { toast } from "react-toastify";
import { useAuth } from "../contexts/AuthContext";
import styled from "styled-components";

const LoginPage = () => {
  const navigate = useNavigate();
  const { login, error } = useAuth();
  const [formData, setFormData] = useState({ email: "", password: "" });
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!formData.email || !formData.password) {
      toast.error("Please enter both email and password");
      return;
    }
    try {
      setLoading(true);
      await login(formData.email, formData.password);
      toast.success("Login successful!");
      navigate("/");
    } catch (err) {
      toast.error(err.message || "Login failed. Please try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <Wrapper>
      <GlassCard>
        <BrandTitle>WildEats</BrandTitle>
        <Subtitle>Welcome back. Happy to see you here.</Subtitle>

        {error && <ErrorBox>{error}</ErrorBox>}

        <Form onSubmit={handleSubmit}>
          <Field>
            <Label>Email</Label>
            <TextInput
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="you@example.com"
            />
          </Field>

          <Field>
            <Label>Password</Label>
            <TextInput
              type="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              placeholder="••••••••"
            />
          </Field>

          <LoginButton disabled={loading}>
            {loading ? "Authenticating..." : "Sign In"}
          </LoginButton>
        </Form>

        <BottomText>
          New here? <StyledLink to="/register">Create an account</StyledLink>
        </BottomText>

        <DemoBox>
          <h4>Demo Accounts</h4>
          <p>Seller: shop.owner@gmail.com / password</p>
          <p>Customer: customer@gmail.com / password</p>
        </DemoBox>
      </GlassCard>
    </Wrapper>
  );
};

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  min-height: 100vh;
  background: linear-gradient(135deg, #faf3f5, #ffe8ee);
  padding: 2rem;
`;

const GlassCard = styled.div`
  backdrop-filter: blur(16px) saturate(160%);
  -webkit-backdrop-filter: blur(16px) saturate(160%);
  background: rgba(255, 255, 255, 0.65);
  border-radius: 16px;
  padding: 3rem 2.5rem;
  box-shadow: 0 8px 32px rgba(0, 0, 0, 0.15);
  width: 100%;
  max-width: 430px;
  animation: fadeIn 0.6s ease;

  @keyframes fadeIn {
    from { opacity: 0; transform: translateY(10px); }
    to { opacity: 1; transform: translateY(0); }
  }
`;

const BrandTitle = styled.h1`
  font-size: 2.2rem;
  font-weight: 800;
  color: #7a0024;
  text-align: center;
`;

const Subtitle = styled.p`
  margin-top: 0.4rem;
  text-align: center;
  color: #444;
`;

const Form = styled.form`
  margin-top: 2rem;
  display: flex;
  flex-direction: column;
  gap: 1.3rem;
`;

const Field = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.4rem;
`;

const Label = styled.label`
  font-weight: 600;
  color: #2c2c2c;
`;

const TextInput = styled.input`
  padding: 0.9rem;
  border-radius: 8px;
  border: 1px solid #ddd;
  background: #fff;
  font-size: 1rem;
  transition: 0.25s ease;

  &:focus {
    outline: none;
    border-color: #7a0024;
    box-shadow: 0 0 0 3px rgba(122, 0, 36, 0.15);
  }
`;

const LoginButton = styled.button`
  margin-top: 0.5rem;
  padding: 0.9rem;
  background: #7a0024;
  color: white;
  font-weight: 600;
  border: none;
  border-radius: 8px;
  cursor: pointer;
  font-size: 1rem;
  transition: 0.25s ease;

  &:hover {
    background: #5a001c;
  }

  &:disabled {
    background: #ccc;
    cursor: not-allowed;
  }
`;

const BottomText = styled.div`
  text-align: center;
  margin-top: 1.8rem;
  color: #555;
`;

const StyledLink = styled(Link)`
  color: #7a0024;
  text-decoration: none;
  font-weight: 600;

  &:hover {
    text-decoration: underline;
  }
`;

const ErrorBox = styled.div`
  background: #ffe5e9;
  color: #b30021;
  padding: 0.8rem;
  border-radius: 8px;
  text-align: center;
  font-size: 0.95rem;
  margin-top: 1rem;
`;

const DemoBox = styled.div`
  margin-top: 2rem;
  border-top: 1px solid #eee;
  padding-top: 1rem;
  font-size: 0.9rem;
  color: #555;

  h4 {
    margin-bottom: 0.4rem;
    color: #333;
  }

  p {
    margin: 0.25rem 0;
  }
`;

export default LoginPage;
